import { gql, useApolloClient } from '@apollo/client';
import '../App.css';
import { GetCustomersLikeNameDocument, SubGetCustomersLikeNameDocument, useCreateCustomerMutation, useDeleteCustomerByPkMutation, useGetCustomersLikeNameQuery, useSubGetCustomersLikeNameSubscription } from '../generated/graphql';
import { CallbackButton } from './CallbackButton';
import { Search } from './Search';
import { Table } from './Table';

export type ContextType = {
  data: {
    data: {
      customers: { email_address: string, first_name: string, last_name: string }[]
    }
  }
}

export const Display = () => {
  const client = useApolloClient()

  const { data } = useGetCustomersLikeNameQuery({
    variables: { limit: 19, first_name_term: "Le%" },
  })
  // reads from cache for this query
  const customers = client.readQuery({
    query: GetCustomersLikeNameDocument,
    variables: { limit: 19, first_name_term: "Le%" }
  })



  console.log(data)
  // this is a stream version of the above query
  const { data: data2 } = useSubGetCustomersLikeNameSubscription({
    variables: { limit: 19, fn_like: "Le%" },
  })

  // const customers_stream = client.readFragment({
  //   variables: { limit: 19, fn_like: "Le%" },
  //   fragment: gql`
  //     fragment Test on
  //   `
  // })


  const [deleteCustomerByPkMutation] = useDeleteCustomerByPkMutation({
    fetchPolicy: 'network-only',
  })
  const [createCustomerMutation] = useCreateCustomerMutation({
    fetchPolicy: "network-only",
  })
  const onAdd = () => {
    createCustomerMutation({
      variables: {
        customer_id: "this-is-a-customerId",
        email_address: "test@test.com",
        last_name: "James",
        first_name: "LeBron"
      }
    })
  }
  const onRemove = () => {
    deleteCustomerByPkMutation({ variables: { customer_id: "this-is-a-customerId" } })
  }


  return (
    <>
      {
        true &&
        <>
          <CallbackButton callback={onAdd} text="Add"></CallbackButton>
          <CallbackButton callback={onRemove} text="remove"></CallbackButton>
          {customers &&
            <Table data={customers} />
          }
        </>
      }
      {true &&
        <Search />
      }
    </>
  )
}

export default Display;
